/** @format */

import React from "react";
import NavBar from "./Component/NavBar";
import TitleHeader from "./Component/TitleHeader";
import Categories from "./Component/Categories";

const App = () => {
  return (
    <div className="color-body font">
      <NavBar />
      <div className="container">
        <TitleHeader/>
        <Categories/>
      </div>
    </div>
  );
};

export default App;
